import React from 'react';

const ReportsPage = ({ user, isDarkMode }) => {
    return ( <
        div className = "bg-white dark:bg-gray-800 p-6 rounded-lg shadow-md transition-colors duration-300" >
        <
        h2 className = "text-2xl font-bold text-gray-800 dark:text-gray-100" > Reports < /h2> <
        p className = "mt-2 text-gray-600 dark:text-gray-300" >
        Welcome to the reports section, { user.name }!This is where you can generate and view various reports. <
        /p> <
        div className = "mt-4 p-4 border rounded-lg bg-gray-50 dark:bg-gray-700 border-gray-200 dark:border-gray-600" >
        <
        p className = "text-gray-500 dark:text-gray-400 italic" >
        Future functionality
        for generating reports will be added here. <
        /p> < /
        div > <
        /div>
    );
};

export default ReportsPage;
